import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
	return (
		<div className='app'>
			<Router>
				<Routes>
					<Route path='/admincustomer' Component={<Customer></Customer>}/>
					<Route path='/customer' Component={<Customer></Customer>}/>
				</Routes>
			</Router>
		</div>
	);
}

export default App;
